from collections import deque
from typing import List
import time


class Solution:
    def findRepeatedDnaSequences(self, s: str) -> List[str]:
        strs_set = set()
        result = list()
        for i in range(len(s) - 9):
            sub_s = s[i : i + 10]
            if sub_s in strs_set and sub_s not in result:
                result.append(sub_s)
            else:
                strs_set.add(sub_s)
        return result

    def findRepeatedDnaSequences1(self, s: str) -> List[str]:
        result = list()
        for i in range(len(s) - 10):
            sub_s = s[i : i + 10]
            for j in range(i + 1, len(s)):
                if sub_s == s[j : j + 10] and s[j : j + 10] not in result:
                    result.append(s[j : j + 10])
        return result


